    false,nt"url": null,nt"notes": "This narrative report for Pea Island NWR
    outlines Refuge accomplishments from September through December of 1954. The report
    begins by summarizing the weather conditions, water conditions, and food and cover
    during this period. Wildlife- including migratory birds and furbearers- is also
    covered. The Refuge development and maintenance section discusses physical developments.
    A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes recreational uses, Refuge visitors,
    and violations. N-R forms are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
